import React, { useState } from "react"
import { Button, Container } from "react-bootstrap";
import CreateBrand from "../components/modals/CreateBrand";
import CreateType from "../components/modals/CreateType";
import CreateClothe from "../components/modals/CreateClothe";

const Admin = () => {
  const [showModal1, setShowModal1] = useState(false);
  const [showModal2, setShowModal2] = useState(false);
  const [showModal3, setShowModal3] = useState(false);

  return (
    <>
      <Button variant="primary" onClick={() => setShowModal1(true)}>
        Открыть модальное окно 1
      </Button>
      {showModal1 && <CreateType show={showModal1} handleClose={() => setShowModal1(false)} />}

      <Button variant="primary" onClick={() => setShowModal2(true)}>
        Открыть модальное окно 2
      </Button>
      {showModal2 && <CreateBrand show={showModal2} handleClose={() => setShowModal2(false)} />}

      <Button variant="primary" onClick={() => setShowModal3(true)}>
        Открыть модальное окно 3
      </Button>
      {showModal3 && <CreateClothe show={showModal3} handleClose={() => setShowModal3(false)} />}
    </>
  );
};

export default Admin;
